export const data = () => {
    return [
    {
        id: '1',
        name: 'Cupcake',
        dishes: [
            {
                name: 'Apple cake',
                price: '10'
            },
            {
                name: 'Pineapple cake',
                price: '10'
            },
            {
                name: 'Strawberry cake',
                price: '10'
            },
            {
                name: 'Vocado cake',
                price: '10'
            },
        ]
    },
    {
        id: '2',
        name: 'Hotpot',
        dishes : [
            {
                name: 'Korean hotpot',
                price: '10'
            },
            {
                name: 'Beef hotpot',
                price: '10'
            },
            {
                name: 'Asian hotpot',
                price: '10'
            },
            {
                name: 'Indian hotpot',
                price: '10'
            }
        ]
    },
    {
        id: '3',
        name: 'Drinks',
        dishes: [
            {
                name: 'Cocacola',
                price: '10'
            },
            {
                name: 'Cocacola',
                price: '10'
            },
            {
                name: 'Cocacola',
                price: '10'
            },
        ]
    }
]
}
